import logo from './logo.svg';
import './App.css';
import React from 'react';
import {BrowserRouter, Route,Routes} from 'react-router-dom';
import NewAnime from './components/Anime/NewAnime';
import ShowAll from './components/Anime/ShowAll';
import ShowOne from './components/Anime/ShowOne';



const App=()=> {

  return (
    <BrowserRouter>
      <div className="App">
        <Routes>
            <Route element={<ShowAll/>} path="/showAll/"></Route>
            <Route element={<ShowOne/>} path="/showOne/"></Route>
            <Route element="" path="/createNew/"></Route>
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
